var $bm_rt;
var amp, freq, decay, n, n, t, t, v;
try {
    amp = $bm_div(effect('Elastic Controller Position')(1), 200);
    freq = $bm_div(effect('Elastic Controller Position')(2), 30);
    decay = $bm_div(effect('Elastic Controller Position')(3), 10);
    $bm_rt = n = 0;
    if (numKeys > 0) {
        $bm_rt = n = nearestKey(time).index;
        if (key(n).time > time) {
            n--;
        }
    }
    if (n == 0) {
        $bm_rt = t = 0;
    } else {
        $bm_rt = t = $bm_sub(time, key(n).time);
    }
    if (n > 0) {
        v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
        $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
    } else {
        $bm_rt = value;
    }
} catch (e$$4) {
    $bm_rt = value = value;
}

